require.register("./components-spirent/dashboard-view-model", Function("exports, module",
"var Paginator = require('./components-spirent/paginator');\n\
\n\
function DashboardViewModel(rootVm) {\n\
    var self = this;\n\
    self.rootVm = rootVm;\n\
\n\
    self.portlets = ko.observableArray();\n\
\n\
    self.leftPortlets = ko.observableArray();\n\
    self.rightPortlets = ko.observableArray();\n\
\n\
    self.favoriteTestsPaginator = new Paginator();\n\
    self.favoriteTests = ko.observableArray();\n\
    self.favoriteTests.extend({ rateLimit: 50 });\n\
    self.favoriteTestsPerPage = 5;\n\
    self.$favoriteTestsPaginator = undefined;\n\
    self.totalFavoriteTests = ko.observable(0);\n\
\n\
    self.tmplTests = ko.observableArray();\n\
    self.testResultsHistory = ko.observableArray();\n\
    self.totalHistoryResults = ko.observable(0);\n\
\n\
    self.showFavoriteTestsPaginator = function() {\n\
        // If Favorite Tests records less than one page shows count, hide the paginator\n\
        if (self.totalFavoriteTests < 5) {\n\
            return ;\n\
        }\n\
\n\
        // If paginator has already loaded, we don't need to initialize it\n\
        //if (self.favoriteTestsPaginator.$el) {\n\
        //    return ;\n\
        //}\n\
\n\
        function get_favorite_tests(page) {\n\
            var page_favorite_tests = self.rootVm.favoriteTests.slice((page - 1) * 5, page * 5);\n\
            var needRequestData = false;\n\
            for (var i = 0; i < page_favorite_tests.length; i++) {\n\
                if (page_favorite_tests[i] === undefined) {\n\
                    needRequestData = true\n\
                    self.rootVm.getFavoriteTests({'page': page, 'page_size': 5}, function () {\n\
                        reset();\n\
                    });\n\
                    break;\n\
                }\n\
            }\n\
            if (!needRequestData) {\n\
                self.favoriteTests.removeAll();\n\
                for (var i = 0; i < page_favorite_tests.length; i++) {\n\
                    self.favoriteTests.push(page_favorite_tests[i]);\n\
                }\n\
            }\n\
        }\n\
\n\
        function page_changed(page) {\n\
            get_favorite_tests(page);\n\
            render_page();\n\
        }\n\
\n\
        function render() {\n\
            if (!self.$favoriteTestsPaginator) {\n\
                self.favoriteTestsPaginator.on('change', page_changed.bind(self));\n\
            }\n\
            self.$favoriteTestsPaginator = document.querySelector('.favorite-tests-paginator');\n\
            reset();\n\
        }\n\
\n\
        function reset() {\n\
            var pages = Math.ceil(self.totalFavoriteTests / self.favoriteTestsPerPage);\n\
\n\
            if (pages !== self.favoriteTestsPaginator.pages()) {\n\
                self.favoriteTestsPaginator.pages(pages);\n\
            }\n\
\n\
            self.favoriteTestsPaginator.render();\n\
            render_page();\n\
        };\n\
\n\
        /*\n\
         * Re-renders list of favorite tests\n\
         *\n\
         * @param page 1-indexed (typically from a paginator)\n\
         */\n\
\n\
        function render_page() {\n\
            while (self.$favoriteTestsPaginator.firstChild) {\n\
                self.$favoriteTestsPaginator.removeChild(self.$favoriteTestsPaginator.firstChild);\n\
            }\n\
            self.$favoriteTestsPaginator.appendChild(self.favoriteTestsPaginator.$el);\n\
        };\n\
\n\
        render();\n\
    };\n\
\n\
    self.getPortlets = function () {\n\
        self.portlets.removeAll();\n\
        $.ajax({\n\
            type: \"GET\",\n\
            url: util.getConfigSetting(\"get_portlets\"),\n\
            dataType: 'json',\n\
            success: function (data, textStatus, jqXhr) {\n\
                var portlets = data;\n\
\n\
                for (var i = 0; i < portlets.length; i++) {\n\
                    var portlet = new PortletViewModel(self);\n\
                    portlet.inflate(portlets[i]);\n\
                    self.portlets.push(portlet);\n\
\n\
                    if (portlets[i].default_column == '.l-portlet-column') {\n\
                        self.leftPortlets.push(portlet);\n\
                    } else if (portlets[i].default_column == '.r-portlet-column') {\n\
                        self.rightPortlets.push(portlet);\n\
                    }\n\
                }\n\
            }\n\
        });\n\
\n\
    };\n\
\n\
    self.initializeTwitterPortlets = function () {\n\
        $(\".tweet\").each(function () {\n\
            $(this).tweet({\n\
                username: $(this).attr('data-twitter-username'),\n\
                join_text: \"auto\",\n\
                avatar_size: 32,\n\
                count: 5,\n\
                template: \"{avatar}{time}<br>{text}\",   // [string or function] template used to construct each tweet <li> - see code for available vars\n\
                auto_join_text_default: null,\n\
                auto_join_text_ed: null,\n\
                auto_join_text_ing: null,\n\
                auto_join_text_reply: null,\n\
                auto_join_text_url: null,\n\
                loading_text: translate(\"Loading tweets...\")\n\
            });\n\
        });\n\
    };\n\
\n\
    self.getPortlets();\n\
}\n\
\n\
function PortletViewModel(dashboardVm) {\n\
    var self = this;\n\
    self.dashboardVm = dashboardVm;\n\
    self.rootVm = dashboardVm.rootVm;\n\
\n\
    self.id = ko.observable();\n\
    self.name = ko.observable();\n\
    self.contentType = ko.observable();\n\
    self.portletContent = ko.observable();\n\
    self.defaultColumn = ko.observable();\n\
    self.templateId = ko.observable();\n\
    self.selectedFilter = ko.observable();\n\
    self.availableFilters = ko.observableArray();\n\
    self.testResultsHistory = self.dashboardVm.testResultsHistory;\n\
\n\
    self.inflate = function (portlet) {\n\
        self.id(portlet.id);\n\
        self.name(portlet.name);\n\
        self.contentType(portlet.content_type);\n\
        self.portletContent(portlet.portlet_content);\n\
        self.defaultColumn(portlet.default_column);\n\
        self.templateId(portlet.div_id_name);\n\
\n\
        self.handleSpecialCases();\n\
    };\n\
\n\
    self.handleSpecialCases = function () {\n\
        switch (self.name()) {\n\
            case 'Recent Results':\n\
                self.selectedFilter('All Statuses');\n\
                break;\n\
        }\n\
    };\n\
\n\
    self.filteredRecentTests = ko.computed(function () {\n\
        var selectedFilter = self.selectedFilter(); //86400000 = 1 day in milliseconds\n\
        var filteredResults = self.testResultsHistory();\n\
        var oldestDate = new Date();\n\
\n\
        oldestDate.setTime(oldestDate.getTime() - (86400000 * 30)); // 30 days ago\n\
\n\
\n\
        filteredResults = self.rootVm.vmHistory.applyDateGreaterThanFilter(oldestDate, filteredResults);\n\
        if (selectedFilter == translate('All Statuses') || selectedFilter == undefined) {\n\
            return filteredResults;\n\
        }\n\
\n\
        return self.rootVm.vmHistory.applyStatusFilter(selectedFilter, filteredResults);\n\
    }).extend({ throttle: self.rootVm.defaultThrottleDuration });\n\
\n\
}\n\
\n\
module.exports = DashboardViewModel;\n\
//# sourceURL=components-spirent/dashboard-view-model/index.js"
));

